site.headStyle:
.background-formu {
    background-image: linear-gradient( 40deg, #00a4e1, #63b495, #63b495, #0c84c9 ); 
    font-family:  'Montserrat Alternates', sans-serif;
}
.form {
  font-size: 10px;
  font-weight: 600;
  letter-spacing: 0.8px;
}

#field2, #field1 ,#field3, input[type=submit] {
    border: none !important;
    border-radius: 8px !important;
    height: 30px !important;

}

#field1, #field2, #field3  {
    margin: 2px 0 12px !important;
}

input[type=submit] {
    width: 30% !important;
    font-weight: 600;
    letter-spacing: 0.8px;
    padding-top: 8px !important;
}

.backgr-text {
    background-image: linear-gradient( 90deg, #2d85dd, #8ac0ae,#8ac0ae, #8ac0ae, #2d85dd ); 
}
